import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
//import Markers from "./Marker";

const Map = props => {
    console.log(props);
    return withScriptjs(
        withGoogleMap(props => (
            <GoogleMap
                defaultZoom={10}
                defaultCenter={{ lat: -34.397, lng: 150.644 }}
            >
                {props.isMarkerShown && (
                    <Marker position={{ lat: -34.397, lng: 150.644 }} />
                )}
            </GoogleMap>
        ))
    );
};

export default MyMapComponent;
